import axios from 'axios';

class ImageHistory extends Component {
    state = {
        images: [],
    }

    componentDidMount() {
        this.getImages()
    }

    getImages = () => {
        axios.get('http://localhost:8000/api/images/', {
            headers: {
                'accept': 'application/json'
            }
        }).then(res=>{
            this.setState({images: res.data})
            console.log(res)
        })
    }

    render() { 
        return ( <h1>Image History here</h1> );
    }
}
 
